              {/*        </i>*/}
              {/*        </span>*/}
              {/*    </img>*/}
              {/*</a>*/}


              {/*<ul className="dropdown-menu animated littleFadeInRight" role="menu">*/}
              {/*    <li>*/}
              {/*        <a href="#">*/}
              {/*            <span className="badge bg-greensea pull-right">86%</span>*/}
              {/*        <i className="fa fa-user" name="user">*/}
              {/*        </i>Profile*/}
              {/*        </a>*/}
              {/*    </li>*/}
              {/*    <li><a href="#"> <i className="fa fa-sign-out" name="sign-out"></i>Logout </a></li>*/}
              {/*</ul>*/}
          </h>

        </header>
        <p className="App-intro">
          To get started, edit <code>src/App.js</code> and save to reload.
        </p>
      </div>
    );
  }
}

export default App;
